import { Stack } from "@mui/material";
import Slider from "../../component/Slider";

export default function Home() {
  return (
    <Stack>
      <Slider />
      <AboutMe />
      <WebsiteBand />
      <Portfolio />
      <WebsiteBand />
      <MySkill />
      <WebsiteBand />
      <ExperienceTimeline />
      <WebsiteBand />
      <Blog />
      <WebsiteBand />
      <Contact />
    </Stack>
  );
}
